import React, { Component } from "react";

class LoginSection extends Component {
  constructor(props) {
    super(props);
    this.state = { username: "", password: "", isAutoLoggedIn: "" };
  }
  render() {
    return (
      <div className="LoginSection">
        <h1 className="welcomeTitle">Welcome</h1>
        <form>
          <InputRow rowFunction="UserName" />
          <InputRow rowFunction="Password" />

        </form>
      </div>
    );
  }
}

function authenticateUser(e) {
  if (this.state.username === "Justin") {
    if (this.state.password === "Justin") {
      return alert("Welcome Justin!");
    } else {
      return alert("Invalid Password");
    }
  } else {
    return alert("No Such User");
  }
}

class UserInput extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  handleSubmit() {}
  render() {
    return (
      <form>
        <div className="form-group row">
          <label for="inputUsername" className="col-sm-1 col-form-label">
            Username
          </label>
          <div className="col-sm-3">
            <input
              type="text"
              className="form-control"
              id="inputUsername"
              placeholder="Username"
            />
          </div>
        </div>
        <div className="form-group row">
          <label for="inputPassword" className="col-sm-1 col-form-label">
            Password
          </label>
          <div className="col-sm-3">
            <input
              type="password"
              className="form-control"
              id="inputPassword"
              placeholder="Password"
            />
          </div>
        </div>
      </form>
    );
  }
}

class InputRow extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="form-group row">
        <label for={this.props.rowFunction} className="col-sm-1 col-form-label">
          {this.props.rowFunction}
        </label>
        <div className="col-sm-3">
          <input
            type="text"
            className="form-control"
            id={this.props.rowFunction}
            placeholder={this.props.rowFunction}
          />
        </div>
      </div>
    );
  }
}

export default LoginSection;
